import { vehicles } from "../../constants";

const Demo_Models = () => {
  return (
    <section className="flex max-md:flex-col">
      <div className="md:w-1/4">
        {vehicles.map((item, index) => {
          return (
            <div className="rounded border border-slate-100 text-sm text-center py-4">
              <h3>{item.model}</h3>
            </div>
          );
        })}
      </div>
      <div className="md:w-3/4"></div>
    </section>
  );
};

export default Demo_Models;
